import React from 'react'
import DecktopIcon from './DesktopIcon/DecktopIcon';
import FolderIcon from "../../../Images/FolderIcon.png"
import MyComputerIcon from "../../../Images/MyComputer.png"
import s from "./Navbar.module.css";
import { useState } from 'react';
import Bin from "../../../Images/Bin.png"

const Navbar = (props) => {

    let [SelectedItem, SetSelectedItem] = useState(0);

    function newChoose(el, link) {
        if(el === SelectedItem) {
            props.SetSelectedItem(el)
        }
        else { 
            SetSelectedItem(el);
        }
    }

    return (
        <div className={ s.Navbar }>
            <div onClick={ () => newChoose(1) }>
                <DecktopIcon isCoosing={ SelectedItem === 1 } image = { MyComputerIcon } name = {"Об олимпиаде"}/>
            </div>
            <div onClick={ () => newChoose(2) }>
                <DecktopIcon isCoosing={ SelectedItem === 2 } image = { FolderIcon } name = {"Направления"}/>
            </div>
            <div onClick={ () => newChoose(3, "/Home/Olimpiad/Stages") }>
                <DecktopIcon isCoosing={ SelectedItem === 3 } image = { FolderIcon } name = {"Этапы"}/>
            </div>
            <div onClick={ () => newChoose(4, "/Home/Olimpiad/Sponsors") }>
                <DecktopIcon isCoosing={ SelectedItem === 4 } image = { FolderIcon } name = {"Спонсоры"}/>
            </div>
            <div onClick={ () => newChoose(5, "/Home/Registration") }>
                <DecktopIcon isCoosing={ SelectedItem === 5 } image = { FolderIcon } name = {"Регстрация"}/>
            </div>
            <div onClick={ () => newChoose(6, "/Home/Error") }>
                <DecktopIcon isCoosing={ SelectedItem === 6 } image = { Bin } name = {"БНТУ"}/>
            </div>
        </div>
    );
}


export default Navbar;
